import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monster1: {
        name: 'Linda',
      },
      monster2: {
        name: 'Roy',
      },
      monster3: {
        name: 'Jacky',
      },
    };
  }

  changeNameHandler() {
    this.setState({ name: 'Roy Chan' });
  }

  render() {
    return <div className='App'></div>;
  }
}

export default App;
